# Urazbayevo, Khaybullinsky District, Republic of Bashkortostan

}}
Urazbayevo (; , Ura≈∫bay) is a rural locality (a village) in Akyulovsky Selsoviet, Khaybullinsky District, Bashkortostan, Russia. The population was 147 as of 2010. There are 5 streets.
Geography
Urazbayevo is located 32 km northeast of Akyar (the district's administrative centre) by road.
